import React from "react";
import styles from "./Result.module.css";
import Printer from "../../../assets/Printer.png";
import Flags from "../../../assets/Flags.png";
import BackgroundImage from "../../../assets/background.png";
import snsBtn from "../../../assets/SNSBtn.png";
import search from "../../../assets/Search.png";

const Result = ({ developerType }) => {
  const printerImage =
    developerType === "front-end" ? Printer : 1;
  const flagsImage = developerType === "front-end" ? Flags : "다른 개발자 유형";
  const snsImage = developerType === "front-end" ? snsBtn : "다른 개발자 유형";

  return (
    <div className={styles.container}>
      <div
        className={styles.backGroundImg}
        style={{ backgroundImage: `url(${BackgroundImage})` }}
      />
      <header className={styles.topTitle}>
        <section className={styles.MaintitleBox}>
          <h5 className={styles.MainTitleContent}>
            {" "}
            당신의 개발자 성향은? <br />{" "}
            {developerType === "front-end"
              ? "프론트엔드(Front-End)"
              : "다른 개발자 유형"}
          </h5>
          <img
            src={search}
            alt="검색이미지입니다."
            className={styles.titleSearch}
          />
        </section>
        <section className={styles.titleContentBox}>
          <div className={styles.titleContent}>
            눈에 보이는 화면을 개발하는 프론트엔드. 디자이너, PM, 백엔드
            사이에서 구체적인 요구사항을 표현합니다. 보다 나은 사용자 경험(UX)를
            위해 개발합니다.
          </div>
        </section>
      </header>
      <main className={styles.contentBox}>
        <div className={styles.printBox}>
          <img
            src={printerImage}
            alt="프린터 이미지입니다."
            className={styles.printer}
          />
        </div>
        <div className={styles.etcBox}>
          <img src={flagsImage} alt="깃발 이미지입니다." className={styles.flags} />
          <img src={snsImage} alt="공유 이미지입니다." className={styles.sns} />
        </div>
      </main>
    </div>
  );
};

export default Result;
